import React from 'react';
import Home1stcomponent from './components/Home1stcomponent.jsx';
import "./homecomponent.css";
import Home2ndsuggestions from './components/Home2ndsuggestions';




export default function Homecomponent() {
    return (
    <div className='homemain'>
        <div className='home1'>
            <Home1stcomponent/>
        </div>
        <div className='home2'> 
            <div>
                <Home2ndsuggestions/>
            </div>
        </div>


    </div>
    )
}
